import React, { useState } from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";
import AddIcon from '@mui/icons-material/Add';
import RemoveIcon from '@mui/icons-material/Remove';

const Childcomponenttable = ({ data }) => {


    const addItem = ()=>{

    }
    const substractItem = () =>{

    }

  return (
    <>
      {
        <Box className="bodyForm">
          <Box className="Product_Component">
            <CardMedia
              component="img"
              alt="This is product"
              className="imageCard"
              image={data.images[1].imageUrl}
              style={{ width: "100px" }}
            />
            <Box className="title_Product">
              <Typography
                className=""
                gutterBottom
                variant="small"
                component="div"
              >
                {data.foodName}
              </Typography>
              <Typography
                className=""
                gutterBottom
                variant="small"
                component="div"
              >
                {data.price} $
              </Typography>
            </Box>
          </Box>
          <Box className="button_Table">
                <Button >
                    <AddIcon />
                </Button>
                    {data.quality}
                 <Button>
                    <RemoveIcon />
                </Button>
          </Box>
          <Typography className="total_Table" gutterBottom variant="small" component="div">
            {data.price * data.quality}
          </Typography>
        </Box>
      }
    </>
  );
};

export default Childcomponenttable;
